function LesThen(a, b) {

    if (TrimString(b.toString()).indexOf(",") != -1) {
        b1 = '0' + b.substring(0, b.indexOf(",")) + '.' + b.substring(b.indexOf(",") + 1);
        b1 = parseFloat(b1);
    }
    else
        b1 = parseFloat(b);

    if (TrimString(a.toString()).indexOf(",") != -1) {
        a1 = '0' + a.substring(0, a.indexOf(",")) + '.' + a.substring(a.indexOf(",") + 1);
        a1 = parseFloat(a1);
    }
    else
        a1 = parseFloat(a);


    if (a1 < b1)
        return true;
    else
        return false;

}

function IsGreaterOrEqualThan(a, b) {

    if (TrimString(b.toString()).indexOf(",") != -1) {
        b1 = '0' + b.substring(0, b.indexOf(",")) + '.' + b.substring(b.indexOf(",") + 1);
        b1 = parseFloat(b1);
    }
    else
        b1 = parseFloat(b);

    if (TrimString(a.toString()).indexOf(",") != -1) {
        a1 = '0' + a.substring(0, a.indexOf(",")) + '.' + a.substring(a.indexOf(",") + 1);
        a1 = parseFloat(a1);
    }
    else
        a1 = parseFloat(a);

    return a1 >= b1;

}


function IsGreaterThan(a, b) {
    a1 = new Number(a);
    b1 = new Number(b);
    return a1 > b1;
}

