function fRoundNum(val, numDec) {
    var fact = Math.pow(10, numDec)
    var ret = String(Math.round(val * fact) / fact)
    numDec++
    dot = ret.indexOf(".");
    if (dot == 0) {
        ret = "0" + ret;
    }
    else if (dot > 0) {
        while (ret.length < dot + numDec) ret = ret + "0";
    }
    return ret
}

