function escapeHTML(s) {
    return s
      .replace(/&/g, '&amp;')
      .replace(/</g, '&lt;')
      .replace(/>/g, '&gt;');
}

function escapeURL(s) {
    return s
      .replace(/&amp;/g, "&");
}

