  function CheckDateWithToday(dateStr, comparer)
 {
    if (dateStr.length ==0)
	{
	    return false;
	}
	
	var result = true;
	var today = new Date();
    today = new Date(today.getFullYear(), today.getMonth(), today.getDate());
	var date = string2date(dateStr);

	switch(comparer)
	{
	    case 'lt' :
	        if(date >= today)
	            result = false;
	        break;
	     case 'l' :
	        if(date > today)
	            result = false;
	        break;
	     case 'gt' :
	        if(date <= today)
	            result = false;
	        break;
	     case 'g' :
	        if(date < today)
	            result = false;
	        break;
	     default : 
	            result = false;
	            break;   
	}
	
	return result;

}

