function SignDigest(who)
{
	if(window.event)
		window.event.cancelBubble = true;

	var nID = who.value;
	if(!who.checked)
	{
		eval("document.forms[0].sign_" + nID + ".value=''");
		return true;
	}
	eval("src = document.forms[0].digest_" + nID + ".value");
	dest = DoSign(src);
	if (""==dest)
	{
		eval("document.forms[0].sign_" + nID + ".value=''");
		return false;
	}
	
	eval("document.forms[0].sign_" + nID + ".value=dest");
	return true;
}

