CalcInLeva = function (Amount, FixRate) {
	if (Amount != undefined)
	{
		var checksum = ToFloat(Amount.val());
		if (FixRate != undefined) {
			checksum = ToFloat(Amount.val()) * ToFloat(FixRate.val());
		}
		return checksum;
	}

	return 0;
}

